import React from 'react';
import {AppBar, Button, Toolbar} from '@material-ui/core';
import './Footer.css';
import './Button.css';
import GithubPic from "../assets/GitHubPic.png";
import GithubLogo from "../assets/GitHubLogo.png";

class Footer extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
          <div>
                <br/><br/><hr/><br/>
                    <div className="text">Designed by Lucas Pao</div>
                    <img src={GithubLogo} style={{height: "20px", width: "auto"}} href="https://github.com/lucaspingpao" target="_blank"></img>
                    <img src={GithubPic} style={{height: "20px", width: "auto"}} href="https://github.com/lucaspingpao" target="_blank"></img>
                    <a href="https://www.youtube.com/channel/UCm0a7WR5C2684z6fL5XNodw" target="_blank"><Button color="primary">YouTube</Button></a>
                <br/><hr/><br/>
          </div>
        );
    }
}

export default Footer;
